import { ICard } from './ICard'

type CardContructorParams = {
  id: string
  front: string
  back: string
}

class Card implements ICard {
  private id: string
  private front: string
  private back: string

  constructor({ id, front, back }: CardContructorParams) {
    this.id = id
    this.front = front
    this.back = back
  }

  get id() {
    return this.id
  }
}

export { Card }
